                });
            }
            if (array[index].includes(".php?id=")) {
                array[index] = "video://" + array[index]
            } else {
                array[index] = array[index].replace(/;/g, '；；') + '#isVideo=true#';
            }
        });
        if (items[group]) {
            if (items[group][title]) {
                items[group][title].url = items[group][title].url.concat(url);
                items[group][title].headers = items[group][title].headers.concat(headers);
            } else {
                items[group][title] = {
                    url: url,
                    headers: headers
                };
            }
        } else {
            items[group] = {};
            items[group][title] = {
                url: url,
                headers: headers
            };
        };
    }
    return items;
}

